 Question: "Some people got on a bus at the terminal. At the first bus stop, 5 more people got in. Then at the second bus stop, 7 people got down and 8 more got in. If there were a total of 20 people heading to the third stop, how many people got on the bus at the terminal?";
Context: "[1]: "There are 50 passengers on a bus.  At the first stop, 16 more passengers get on the bus. On the other stops, 22 passengers get off the bus and 5 passengers more get on the bus. How many passengers are there on the bus in total at the last station?There are 50+16=<<50+16=66>>66 passengers at first.\nThen 66 - 22 = <<66-22=44>>44 passengers remain.\nSince 5 more passengers get on the bus there are 44 + 5 = <<44+5=49>>49 passengers on the bus.\n#### 49"

Answer: 49 people got on the bus at the terminal.

 Question: "Bobby takes a 30 min lunch and 2 15 minutes break per day at the office.  After 5 days, how many hours do his lunches and breaks add up to?";
Context: "[1]: "Justin wanted to watch a movie that came on at 8 pm that night.  His parents agreed as long as he finished his homework and chores before the movie started.  He wouldn't be home until 5 pm because of baseball practice.  He knew dinner would take 45 minutes, and he figured his homework would take 30 minutes to finish.  He needed to clean his room, which would take 30 minutes; then take out the trash, which would take about 5 minutes; and empty the dishwasher,  which would take another 10 minutes.  What was the latest time that Justin could start his chores and homework to be done by 8 pm to watch his movie?Justin would spend 45 minutes at dinner, 30 minutes doing homework, 30 minutes cleaning his room, 5 minutes on the trash and 10 on dishes for a total of 45+30+30+5+10 = <<45+30+30+5+10=120>>120\nJustin knows that 60min is the same as 1 hour. He has 120 minutes of work so 120/60 = <<120/60=2>>2 hours\nHis movie comes on at 8 pm and he has 2 hours of chores so 8-2 = <<8-2=6>>6 pm is the latest time he could start his chores\n#### 6"

Answer: 6
